import React, { useState } from "react";

const AdminDashboard = () => {
  // Dummy data for now
  const [cars, setCars] = useState([
    { id: 1, name: "Toyota Corolla", price: 20000, currency: "USD" },
    { id: 2, name: "Honda Civic", price: 2500000, currency: "KES" },
  ]);

  const [users, setUsers] = useState([
    { id: 1, name: "Alice", email: "alice@mail.com" },
    { id: 2, name: "Bob", email: "bob@mail.com" },
  ]);

  const [newCar, setNewCar] = useState({ name: "", price: "", currency: "USD" });

  // Add car
  const handleAddCar = (e) => {
    e.preventDefault();
    if (!newCar.name || !newCar.price) return;
    setCars([...cars, { id: Date.now(), ...newCar }]);
    setNewCar({ name: "", price: "", currency: "USD" });
  };

  // Delete car
  const handleDeleteCar = (id) => {
    setCars(cars.filter((car) => car.id !== id));
  };

  // Delete user
  const handleDeleteUser = (id) => {
    setUsers(users.filter((user) => user.id !== id));
  };

  return (
    <div className="container mt-5">
      <h1 className="mb-4">⚙️ Admin Dashboard</h1>

      {/* Manage Cars */}
      <div className="card mb-4">
        <div className="card-header">🚗 Manage Cars</div>
        <div className="card-body">
          <form onSubmit={handleAddCar} className="row g-2 mb-3">
            <div className="col-md-4">
              <input
                type="text"
                placeholder="Car Name"
                className="form-control"
                value={newCar.name}
                onChange={(e) => setNewCar({ ...newCar, name: e.target.value })}
              />
            </div>
            <div className="col-md-3">
              <input
                type="number"
                placeholder="Price"
                className="form-control"
                value={newCar.price}
                onChange={(e) => setNewCar({ ...newCar, price: e.target.value })}
              />
            </div>
            <div className="col-md-3">
              <select
                className="form-select"
                value={newCar.currency}
                onChange={(e) =>
                  setNewCar({ ...newCar, currency: e.target.value })
                }
              >
                <option value="USD">USD ($)</option>
                <option value="KES">KES (KSh)</option>
                <option value="EUR">EUR (€)</option>
                <option value="GBP">GBP (£)</option>
              </select>
            </div>
            <div className="col-md-2">
              <button type="submit" className="btn btn-primary w-100">
                Add Car
              </button>
            </div>
          </form>

          <ul className="list-group">
            {cars.map((car) => (
              <li
                key={car.id}
                className="list-group-item d-flex justify-content-between align-items-center"
              >
                {car.name} — {car.currency} {car.price}
                <button
                  className="btn btn-danger btn-sm"
                  onClick={() => handleDeleteCar(car.id)}
                >
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>
      </div>

      {/* Manage Users */}
      <div className="card">
        <div className="card-header">👤 Manage Users</div>
        <div className="card-body">
          <ul className="list-group">
            {users.map((user) => (
              <li
                key={user.id}
                className="list-group-item d-flex justify-content-between align-items-center"
              >
                {user.name} ({user.email})
                <button
                  className="btn btn-danger btn-sm"
                  onClick={() => handleDeleteUser(user.id)}
                >
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
